import axios from 'axios'
import config from '../config'

import {
  ISS_REQUEST_PENDING,
  ISS_REQUEST_SUCCESS,
  ISS_REQUEST_ERROR,
  ISS_ADDRESS_REQUEST_SUCCESS,
  ISS_ADDRESS_REQUEST_ERROR,
} from '../store/constants'

/**
 *
 * @param {array} data
 */
export function getLocationRequestSuccess(data) {
  return {
    type: ISS_ADDRESS_REQUEST_SUCCESS,
    payload: data,
  }
}

/**
 *
 * @param {string} err
 */
export function getLocationRequestError(err) {
  return {
    type: ISS_ADDRESS_REQUEST_ERROR,
    payload: err,
  }
}

/**
 *
 * @param {number} lat
 * @param {number} lng
 */
export function getLocationRequest(lat, lng) {
  return async (dispatch) => {
    try {
      const { data } = await axios.get('https://maps.googleapis.com/maps/api/geocode/json', {
        params: {
          latlng: `${lat},${lng}`,
          key: config.googleMapsKey,
        },
      })
      dispatch(getLocationRequestSuccess(data.results))
    } catch (err) {
      dispatch(getLocationRequestError('Can not get addresses from Google API.'))
    }
  }
}

/**
 * Sending request to http://wheretheiss.at/
 * https://api.wheretheiss.at/v1/satellites/25544/positions?timestamps=1436029892,1436029902&units=miles
 */
export function getIssPositionRequestPending() {
  return {
    type: ISS_REQUEST_PENDING,
  }
}

/**
 *
 * @param {Object} data
 */
export function getIssPositionRequestSuccess(data) {
  return {
    type: ISS_REQUEST_SUCCESS,
    payload: data,
  }
}

/**
 *
 * @param {string} err
 */
export function getIssPositionRequestError(err) {
  return {
    type: ISS_REQUEST_ERROR,
    payload: err,
  }
}

/**
 * Http request to api
 */
export function getIssPositionRequest() {
  return async (dispatch) => {
    dispatch(getIssPositionRequestPending())
    try {
      const { data } = await axios.get('https://api.wheretheiss.at/v1/satellites/25544')
      dispatch(getIssPositionRequestSuccess(data))
      dispatch(getLocationRequest(data.latitude, data.longitude))
    } catch (err) {
      const { error } = err.response.data
      dispatch(getIssPositionRequestError(error))
      setTimeout(() => {
        dispatch(getIssPositionRequest())
      }, 5000)
    }
  }
}

import React, { Component } from 'react'
import { connect } from 'react-redux'
import PropTypes from 'prop-types'
import { Row, Col } from 'react-grid-system'
import Subheader from 'material-ui/Subheader'

import Map from './Map'
import Loader from './Loader'
import Addresses from './Addresses'
import ErrorMessage from './ErrorMessage'
import { getIssPositionRequest } from './issActions'


class ISSPage extends Component {
  static propTypes = {
    getIssPositionRequest: PropTypes.func.isRequired,
    iss: PropTypes.object.isRequired,
    isLoading: PropTypes.bool.isRequired,
    errorMessage: PropTypes.string.isRequired,
    addressData: PropTypes.array.isRequired,
  }

  componentDidMount() {
    this.props.getIssPositionRequest()
  }

  render() {
    const { iss, isLoading, errorMessage, addressData } = this.props
    const isGeoData = Object.getOwnPropertyNames(iss).length > 1
    return (
      <Row>
        <Col xs={12} lg={6} style={{ marginBottom: 15 }}>
          <Subheader>Current location of ISS</Subheader>
          <ErrorMessage message={errorMessage} />
          <Addresses data={addressData} />
          { isLoading && <Loader /> }
        </Col>
        <Col xs={12} lg={6}>
          { isGeoData && <Map
            lat={iss.latitude}
            lng={iss.longitude}
          /> }
        </Col>
      </Row>
    )
  }
}

const mapStateToProps = state => ({
  iss: state.iss.data,
  isLoading: state.iss.loading,
  errorMessage: state.iss.error,
  addressData: state.iss.addressData,
})

export default connect(mapStateToProps, { getIssPositionRequest })(ISSPage)

import {
  ISS_REQUEST_PENDING,
  ISS_REQUEST_SUCCESS,
  ISS_REQUEST_ERROR,
  ISS_ADDRESS_REQUEST_SUCCESS,
  ISS_ADDRESS_REQUEST_ERROR,
} from '../store/constants'

const initialState = {
  loading: false,
  data: {},
  error: '',
  addressData: [],
}

/**
 * ISS Reducer
 * @param {Object} state
 * @param {Object} action
 * @return {Object}
 */
export default (state = initialState, action = {}) => {
  switch (action.type) {
    case ISS_REQUEST_PENDING:
      return { ...state, loading: true }
    case ISS_REQUEST_SUCCESS:
      return { ...state, data: action.payload, error: '' }
    case ISS_ADDRESS_REQUEST_ERROR:
    case ISS_REQUEST_ERROR:
      return { ...state, loading: false, error: action.payload }
    case ISS_ADDRESS_REQUEST_SUCCESS:
      return { ...state, loading: false, addressData: action.payload }
    default: return state
  }
}

